import React from "react";
import PropTypes from "prop-types";

const CardInfo = ({ onClose }) => {
  return (
    <div className="popup-overlay d-flex justify-content-center align-items-center">
      <div className="popup p-4">
        <button className="close-button" onClick={onClose}>
          X
        </button>
        <button className="btn" onClick={onClose}>
          
        </button>
        <div className="container mt-3">
          <h1 className="h3">Title</h1>
          <p>Description</p>
          <span>Subtasks</span>
          <div className="status-buttons mt-2">
            <button className="btn btn-success mr-2">Completed</button>
            <button className="btn btn-warning mr-2">In Progress</button>
            <button className="btn btn-danger">Pending</button>
          </div>
        </div>
      </div>
    </div>
  );
};

CardInfo.propTypes = {
  onClose: PropTypes.func.isRequired,
};

export default CardInfo;
